import React from 'react';
import { Routes, Route, Navigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import AddEmployee from './components/addUser';
import EditEmployee from './components/editUser';
import EmployeeDataTable from './components/userDataTable';

function App() {

  return (

    <div class="container card mb-4 box-shadow">

      <div class="card-header">
        <h4 class="my-0 font-weight-normal">CDN CRUD</h4>
      </div>

      <Routes>
        <Route path="/" element={<Navigate to="/read" />} />
        <Route exact path="/create" element={<AddEmployee />} />
        <Route exact path="/read" element={<EmployeeDataTable />} />
        <Route path="/edit/:id" element={<EditEmployee />} />
      </Routes>

    </div>
  );
}

export default App;
